    return <nav class="navbar-list">
        <NavbarItem title="Home" />
        <NavbarItem title="Explore" />
        <NavbarItem title="Notifications" />
        <NavbarItem title="Messages" />
        <NavbarItem title="Profile" />
        <NavbarItem title="More" />
        <TwweetBtn />
    </nav>
}

export default Navbar;
